import React from 'react';
import ReactDOM from 'react-dom';

function Title(){
  return (
    <div className = 'book'>
      The Title
    </div>
  )
}

function Author() {
  return (
    <div className = 'author'>
      The Author
    </div>
  );
}

function Rating() {
  return (
    <li className = 'rating'>
      5 stars
    </li>
  )
}

function ISBN() {
  return (
    <li className = 'isbn'>
      12-345678-910
    </li>
  )
}

function Stats() {
  return (
    <ul className = 'stats'>
      <Rating/>
      <ISBN/>
    </ul>
  )
}

function JSXlines() {
  return (
    <div>
      NewLine
      Test
    </div>
  )
}

function MyThing() {
  return (
    <div className = 'book'>
      <Title/>
      <Author/>
      <Stats/>
    </div>
  )
}

ReactDOM.render(
  <MyThing/>,
  document.querySelector('#root')
);
